import React from "react";
import "./Card.scss";

function Card(props, lunar) {
  console.log(props.lunar);
  return (
    <div className="card">
      <span>{lunar && !lunar}</span>
      <article>
        <h2>title {props.lunar}</h2>
        <p>text</p>
        <p>text</p>
        <p>text</p>
      </article>
    </div>
  );
}

export default Card;
